import React, { Component } from 'react';
import {Route, NavLink, Switch} from "react-router-dom";
import Home from './pages/home';

import Nav from './components/navbar/navbar';
import Fam from './components/email/join';
import Foot from './components/footer/sponsor';

import About from './pages/about/about';
import Rules from './pages/rules/rules';
import Regi from './pages/register/register';
import Events from './pages/events/events';
import Pricing from './pages/pricing/pricing';
import Pay from './pages/payment/payment';

import './App.css';

import {
  CSSTransition,
  TransitionGroup,
} from 'react-transition-group';


function App() {
  return (
    <div className="App">

          {/*Navigation*/}
          <Nav />
          <Route render={({location}) => (
            <TransitionGroup>

              <CSSTransition
                key={location.key}
                timeout={450}
                classNames="fade"
              >
                <Switch location={location}>

                  {/*Routes for Different Pages*/}

                  {window.scrollBy({top: 0, left: 0, behavior: 'smooth'})}

                  <Route exact path="/" onUpdate={() => window.scrollBy(0, 0)} component={Home} />
                  <Route path="/About" onUpdate={() => window.scrollBy(0, 0)} component={About} />
                  <Route path="/Rules" onUpdate={() => window.scrollBy(0, 0)} component={Rules} />
                  <Route path="/Register" onUpdate={() => window.scrollBy(0, 0)} component={Regi} />
                  <Route path="/Events" onUpdate={() => window.scrollBy(0, 0)} component={Events} />
                  <Route path="/Classes" onUpdate={() => window.scrollBy(0, 0)} component={Pricing} />
                  <Route path="/Payment" onUpdate={() => window.scrollBy(0, 0)} component={Pay} />

                </Switch>

              </CSSTransition>

          </TransitionGroup>
          )} />
          {/*Email and Footer*/}
          <Fam />
          <Foot />

    </div>
  );
}

export default App;
